// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Ownable.sol";
import "./WhitelistManager.sol";
import "./ProductManager.sol";
import "./AccessControl.sol";

contract MainContract is Ownable, WhitelistManager, ProductManager, AccessControl {
    // Using SafeMath for safe arithmetic operations
    using SafeMath for uint256;

    // Function to add an address to the whitelist
    function addToWhitelist(address addr) public onlyOwner {
        super.addAddressToWhitelist(addr);
    }

    // Function to remove an address from the whitelist
    function removeFromWhitelist(address addr) public onlyOwner {
        super.removeAddressFromWhitelist(addr);
    }

    // Function to create a new product
    function createNewProduct(string memory name, uint256 lotNumber, uint256 totalPerLot, address manufacturer) public {
        require(isWhitelisted(manufacturer), "MainContract: Manufacturer must be whitelisted");
        super.createProduct(name, lotNumber, totalPerLot, manufacturer);
    }

    // Function to transfer ownership of a product
    function transferProduct(uint256 productId, address newOwner) public {
        require(isWhitelisted(newOwner), "MainContract: New owner must be whitelisted");
        super.transferProductOwnership(productId, newOwner);
    }

    // Assign a role to a user
    function assignUserRole(address user, uint256 role) public onlyOwner {
        super.assignRole(user, role);
    }

    // Revoke a role from a user
    function revokeUserRole(address user) public onlyOwner {
        super.revokeRole(user);
    }

    // Additional functions can be implemented to extend functionality
}

contracts/AccessControl.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Ownable.sol";

contract AccessControl is Ownable {
    mapping(address => uint256) public roles;  // 0: None, 1: Admin, 2: Manufacturer, 3: Distributor, 4: Retailer, 5: Consumer

    event RoleAssigned(address indexed user, uint256 indexed role);
    event RoleRevoked(address indexed user, uint256 indexed oldRole);

    function assignRole(address user, uint256 role) public onlyOwner {
        roles[user] = role;
        emit RoleAssigned(user, role);
    }

    function revokeRole(address user) public onlyOwner {
        uint256 oldRole = roles[user];
        roles[user] = 0;  // Assign no role
        emit RoleRevoked(user, oldRole);
    }

    modifier onlyRole(uint256 role) {
        require(roles[msg.sender] == role, "AccessControl: insufficient permission");
        _;
    }
}

contracts/ProductManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Ownable.sol";
import "./SafeMath.sol";

contract ProductManager is Ownable {
    using SafeMath for uint256;

    struct Product {
        uint256 id;
        string name;
        uint256 lotNumber;
        uint256 totalPerLot;
        address manufacturer;
        address currentOwner;
        uint256 purchaseDate;
    }

    Product[] public products;
    uint256 public nextProductId;

    event ProductCreated(uint256 indexed productId, string productName);
    event OwnershipTransferred(uint256 indexed productId, address indexed previousOwner, address indexed newOwner);

    constructor() Ownable() {
        nextProductId = 0;
    }

    function createProduct(string memory name, uint256 lotNumber, uint256 totalPerLot, address manufacturer) public onlyOwner {
        products.push(Product({
            id: nextProductId,
            name: name,
            lotNumber: lotNumber,
            totalPerLot: totalPerLot,
            manufacturer: manufacturer,
            currentOwner: manufacturer,  // Initially, the manufacturer owns the product
            purchaseDate: block.timestamp  // Timestamp of product creation
        }));
        emit ProductCreated(nextProductId, name);
        nextProductId = nextProductId.add(1);
    }

    function transferProductOwnership(uint256 productId, address newOwner) public {
        require(msg.sender == products[productId].currentOwner, "ProductManager: caller is not the current owner");
        address previousOwner = products[productId].currentOwner;
        products[productId].currentOwner = newOwner;
        products[productId].purchaseDate = block.timestamp;  // Update purchase date on transfer
        emit OwnershipTransferred(productId, previousOwner, newOwner);
    }

    function getProductDetails(uint256 productId) public view returns (Product memory) {
        require(productId < nextProductId, "ProductManager: invalid product ID");
        return products[productId];
    }
}

contracts/WhitelistManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Ownable.sol";

contract WhitelistManager is Ownable {
    mapping(address => bool) private _whitelist;

    event WhitelistedAddressAdded(address indexed addr);
    event WhitelistedAddressRemoved(address indexed addr);

    function addAddressToWhitelist(address addr) public onlyOwner {
        require(addr != address(0), "WhitelistManager: address is the zero address");
        _whitelist[addr] = true;
        emit WhitelistedAddressAdded(addr);
    }

    function removeAddressFromWhitelist(address addr) public onlyOwner {
        require(addr != address(0), "WhitelistManager: address is the zero address");
        _whitelist[addr] = false;
        emit WhitelistedAddressRemoved(addr);
    }

    function isWhitelisted(address addr) public view returns (bool) {
        return _whitelist[addr];
    }
}

contracts/Ownable.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Ownable {
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    constructor() {
        _owner = msg.sender;
        emit OwnershipTransferred(address(0), msg.sender);
    }

    function owner() public view returns (address) {
        return _owner;
    }

    modifier onlyOwner() {
        require(_owner == msg.sender, "Ownable: caller is not the owner");
        _;
    }

    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
}

